import React from "react";

import Boy from "../Images/boy.png";
import TextLeftFirstScreen from "../Images/textFirstScreen.png";

import classes from "./styles.module.css";

const FirstScreen = () => {
  return (
    <div className={classes.container}>
      <div className={classes.leftTextFirstScreen}>
        <img
          src={TextLeftFirstScreen}
          alt=""
          className={classes.imgLeftFirstScreen}
        />
      </div>
      <div>
        <img src={Boy} alt="" className={classes.imgRightFirstScreen} />
      </div>
    </div>
  );
};

export default FirstScreen;
